import React from "react";
import { useDispatch } from "react-redux";
import DropdownAction from "~/components/elements/basic/DropdownAction";
import styles from "../TableExtraStyles/extraStyles.module.css";

function PendingBidColumn({bidE, num}) {
	const dispatch = useDispatch();

      const approveEvent = ()=>{
            console.log('approve event')
            dispatch(bidE.id)
      }



	return (
		<tr>
			<td>{num + 1}</td>
			<td>
				<strong>{bidE.product_id}</strong>
			</td>
			<td>{bidE.start_time}</td>
			<td>{bidE.access_amount}</td>
			<td>{bidE.minimum_amount}</td>
			<td>{bidE.createdAt}</td>
			{/* <td>{badgeView}</td> */}
			<td>
				<button onClick={approveEvent} className={styles.createEventButton}>Approve Event</button>
			</td>
			<td>
				<DropdownAction type="bidE" id={bidE.id} key={num + 1} />
			</td>
		</tr>
	);
}

export default PendingBidColumn;
